import React from 'react';
import '../App.css';
import './ConnectPage.css';
import { Button } from './Button';

function ConnectPage() {
  return (
    <div className='central'>
        <Button
          className='login'
          to='/Login'
        >
            LOGIN
        </Button>
        <Button
          className='signup'
          to='/Create'
        >
           SIGNUP
        </Button>
    </div>
  );
}

export default ConnectPage;
